import React from 'react';
import styles from './Sort.module.scss';
const Sort = () => {
  return (
    <div className={styles.sort}>
      <span>xxx</span>

      <div>
        <ul>
          <li>xxx</li>
        </ul>
      </div>
    </div>
  );
};

export default Sort;
